// https://leetcode.com/problems/subarray-sums-divisible-by-k/description/

// Given an integer array nums and an integer k, return the number of non-empty
// subarrays that have a sum divisible by k.
//
// A subarray is a contiguous part of an array.

// Classic prefix sum modulo method:
// 1. Calculate the cumulative sum of the array.
// 1. Calculate the moduo for each sum.
// 1. If two modulos are equal, then the array in between the indices where
//    these modulos happened has a sum % k == 0.  
//    If we find a modulo 0 at any point, that is also a solution (a prefix of
//    the array matches).
func subarraysDivByK(nums []int, k int) int {
  res := 0
  prefixModulo := 0

  // We set the 0 modulo to 1 because if at any point the modulo is equal to 0
  // for the first time, this means the prefix itself is a valid subarray. We
  // don't need to wait for a second value.
  modulos := map[int]int{ 0: 1 }
  for i := 0 ; i < len(nums) ; i++ {
    // The + k and double % is to handle negative numbers.
    // This works because we don't care about the actual value, just the relative position compared to k.
    prefixModulo = (prefixModulo + (nums[i] % k) + k) % k

    // When we have 1 past value, adding one makes a pair (two bounds) for an array.
    // When we have 2 past values, adding one basically adds a new upper bound for each of them.
    res += modulos[prefixModulo]

    // modulos[int(math.Abs(float64(modulo)))]++
    modulos[prefixModulo]++
    // fmt.Printf("sum %d\n", sum)
    // fmt.Printf("modulos %v\n", modulos)
    // fmt.Printf("res %v\n", res)
  }
  // fmt.Printf("modulos %v\n", modulos)

  return int(res)
}


